    for query in queries:
        (sign, x, answer) = query
        x = int(x)
        if answer == 'Y':
            if sign == '>':
                l = max(l, x + 1)
            elif sign == '>=':
                l = max(l, x)
            elif sign == '<':
                r = min(r, x - 1)
            elif sign == '<=':
                r = min(r, x)
        elif sign == '<=':
            l = max(l, x + 1)
        elif sign == '<':
            l = max(l, x)
        elif sign == '>=':
            r = min(r, x * 1)
        elif sign == '>':
            r = min(r, x)
    if r < l:
        return 'Impossible'
    elif r == 1000000001 and l == -1000000001:
        return 1
    elif r == 1000000001:
        return l
    elif l == -1000000001:
        return r
    else:
        return r

